$(document).ready((function(){$.get("https://raw.githubusercontent.com/kgbzen/archive/main/projects.json",(function(e){var t=JSON.parse(e).projects,o=$("#items-list");t.forEach((function(e){var t=new Date(1e3*e.date);o.append(`<li class="list-group-item mb-1 impress-group-item" url="${e.url}" onclick="loadMarkDown(this)"><div class="row"><div class="col-auto d-flex justify-content-center my-auto"><img class="img-fluid shadow" src="https://kgbapi.herokuapp.com/square?t=${(new Date).getTime()}" width="85px" style="border: 1px solid rgb(0,0,0);" /></div><div class="col"><h5 style="font-family: 'Noto Sans JP', sans-serif;font-weight: bold;">${e.name}</h5><code>${new Intl.DateTimeFormat("en-GB",{weekday:"short",year:"numeric",month:"short",day:"numeric"}).format(t)}</code><p style="font-family: 'Noto Sans JP', sans-serif;">${e.description}</p></div></div></li>`)}))}))}));